	["Test test one two. Hello Petrus, can you hear me? What an irony... Alright, to the point: Thanks to the power of my justice and with the help of the King of Rats, Tomek, I managed to gather all the fragments of my soul back together. These fragments traveled through the endless cosmos, but I found them all and merged them. I was trapped in that state for what seemed like ages. During that time, I managed to shed my human shell. Wait... who am I?"] = "Test test one two. Hello Petrus, can you hear me? What an irony... Alright, to the point: Thanks to the power of my justice and with the help of the King of Rats, Tomek, I managed to gather all the fragments of my soul back together. These fragments traveled through the endless cosmos, but I found them all and merged them. I was trapped in that state for what seemed like ages. During that time, I managed to shed my human shell. Wait... who am I?",
	["Rat of Kings... Yes, I used to be called that. But I'm no longer the Rat of Kings. I am Astral Janus, and I have a {mission} for you!"] = "Rat of Kings... Yes, I used to be called that. But I'm no longer the Rat of Kings. I am Astral Janus, and I have a {mission} for you!",
	["Our latest target is a notorious businessman known for supporting literal fascists. He's hiding in one of his bases in space. You won't be able to reach him by conventional means, so you can start by going to the Usha'Yaan Forge. They specialize in manufacturing various spacecraft-like products."] = "Our latest target is a notorious businessman known for supporting literal fascists. He's hiding in one of his bases in space. You won't be able to reach him by conventional means, so you can start by going to the Usha'Yaan Forge. They specialize in manufacturing various spacecraft-like products.",
	["The Usha'Yaan Forge located in the deepest chasms in the dwarven caves on Hurghada. To gain access to the forge, you need to know a special {codeword} and recite it in ancient dwarven just outside the entrance on the third Sunday of the leap year. Although I'm not entirely sure about the last requirements. Inside, you'll find Qasim the blacksmith, who will tell you how to craft a new spaceship."] = "The Usha'Yaan Forge located in the deepest chasms in the dwarven caves on Hurghada. To gain access to the forge, you need to know a special {codeword} and recite it in ancient dwarven just outside the entrance on the third Sunday of the leap year. Although I'm not entirely sure about the last requirements. Inside, you'll find Qasim the blacksmith, who will tell you how to craft a new spaceship.",
	["Qasim, also known to many as Cassim, once had a younger brother, who, against his wishes, tried to enter the Usha'Yaan Forge. He didn't know the password when he was near the sealed doors. Suddenly, an opportunity arose - he overheard his brother and a few accomplices heading for the forge. He hid behind nearby rocks, right by the lava lake. Everyone there is accustomed to high temperatures, so the position he found himself in wasn't too uncomfortable. Eventually, he managed to eavesdrop on the password. And the password is... Well, all I know is that his younger brother now was one of the only people who know this password."] = "Qasim, also known to many as Cassim, once had a younger brother, who, against his wishes, tried to enter the Usha'Yaan Forge. He didn't know the password when he was near the sealed doors. Suddenly, an opportunity arose - he overheard his brother and a few accomplices heading for the forge. He hid behind nearby rocks, right by the lava lake. Everyone there is accustomed to high temperatures, so the position he found himself in wasn't too uncomfortable. Eventually, he managed to eavesdrop on the password. And the password is... Well, all I know is that his younger brother now was one of the only people who know this password.",
